import './App.css';
import Header from './components/Header';
import Main from './components/Main';
import Nav from './components/Nav';


const App = () => {
  return (
    <div className="b-app-wrapper">
      <Header/>
      <Nav/>
      <Main/>
    </div>
  );
}

export default App;
